values:
I tried to give myself all the reasons to smile, but apparently none of it works.
When my mum is around, I "smile".&nbsp;
Trying my best to conceal my feeling, I am not as happy as what you see.

My words are not reaching your head, I shall keep quiet and not say anything. 
I decided to hibernate, which means I won't be going out.&nbsp; 
I&nbsp;need time to reprocess my thoughts. 

I am not going out!&nbsp; 
No movie, no dinner. Just Ikea only. =)
